INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES ("2020/04/30 12:00:00", 0.0, 102601, 1, 0.0, 24, "2030/12/17 14:59:59", 10040, 0, 0.0, "あたしだって\nやるときはやるよ！", "リン", 1, 24001);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES ("2020/04/30 12:00:00", 0.0, 102601, 1, 0.0, 24, "2030/12/17 14:59:59", 10040, 1, 0.0, "ふぅ…\nこれであたしの仕事は\n終わりだね", "リン", 1, 24002);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES ("2020/04/30 12:00:00", 0.0, 102601, 1, 0.0, 24, "2030/12/17 14:59:59", 10040, 2, 0.0, "終わった終わった\n一人でもなんとか\nなるもんだね", "リン", 1, 24003);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES ("2020/04/30 12:00:00", 0.0, 102601, 2, 0.0, 24, "2030/12/17 14:59:59", 10040, 3, 0.0, "やったね！\nこれでようやく\nサボれるよ…", "リン", 2, 24004);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES ("2020/04/30 12:00:00", 0.0, 102601, 1, 0.0, 24, "2030/12/17 14:59:59", 10040, 4, 0.0, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", "リン", 1, 24005);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES ("2020/04/30 12:00:00", 0.0, 102601, 2, 0.0, 24, "2030/12/17 14:59:59", 10040, 5, 0.0, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", "リン", 2, 24006);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES ("2020/04/30 12:00:00", 0.0, 102601, 2, 0.0, 24, "2030/12/17 14:59:59", 10040, 6, 0.0, "あたしも意外と\nやるもんでしょ？", "リン", 2, 24007);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES ("2020/04/30 12:00:00", 0.0, 102601, 4, 0.0, 24, "2030/12/17 14:59:59", 10040, 7, 0.0, "疲れた…\nねずみの逃げ足\n速すぎるよ…", "リン", 4, 24008);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES ("2020/04/30 12:00:00", 0.0, 102601, 4, 0.0, 24, "2030/12/17 14:59:59", 10040, 8, 0.0, "このままじゃ\nまっひ～に\n叱られちゃうよ", "リン", 4, 24009);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES ("2020/04/30 12:00:00", 0.0, 102601, 4, 0.0, 24, "2030/12/17 14:59:59", 10040, 9, 0.0, "まじめに\nやったんだけどな…\n悔しいな～", "リン", 4, 24010);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES ("2020/04/30 12:00:00", 0.0, 102601, 4, 0.0, 24, "2030/12/17 14:59:59", 10040, 10, 0.0, "やられた…\nねずみって意外と\nてごわいね", "リン", 4, 24011);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES ("2020/04/30 12:00:00", 0.0, 102601, 4, 0.0, 24, "2030/12/17 14:59:59", 10040, 11, 0.0, "おのれ～\nあたしのチーズを\n盗みやがって～！", "リン", 4, 24012);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES ("2020/04/30 12:00:00", 1.81, 102601, 4, 0.0, 24, "2030/12/17 14:59:59", 10040, 12, 0.0, "疲れた…\nけど、次こそは\n守り抜くよ…", "リン", 1, 24013);
